import React from 'react';

import Button from '@material-ui/core/Button';
import DeleteIcon from '@material-ui/icons/Delete';






const Keep = ()=>{
    return(
        <>
             <div id="noteDiv">
                 <h3>The Title</h3> 
                 <br/>
                <p id="note">
                        The Content
                </p>
                <Button id="delbtn">
                    <DeleteIcon id="del" />
                </Button>
            </div>
            <h1> This Keeper App </h1>
        </>
    )
}




export default Keep;
